@cflw 编写了知乎专栏文章[用python编写控制网络设备的自动化脚本1：框架设计](https://zhuanlan.zhihu.com/p/53641620). 关于爬虫库开发, 也许在未来有实际应用时实施.

@nobodxbodon 对vscode插件进行了[功能改进](https://zhuanlan.zhihu.com/p/53288297)且暂停项目, 争取两周之内开始[知识库](https://github.com/program-in-chinese/overview/issues/97)第一步, 考虑从度量衡开始(与 https://github.com/program-in-chinese/overview/issues/61 也有关)

qq@fool 介绍了中文语法编程语言转换为Python的思路. 个人建议先以假想的Python用户为目标读者, 编写一个使用说明, 其中落实语法定义(包括关键词映射, 句子中所处位置, 断句规则等等).

@htwx 演示了[CTS](https://github.com/program-in-chinese/CTS)的拼音输入+自动补全功能.

最后, 祝贺 @absente 收到Python书稿邀约! 讨论了一些可能的主题. 非常期待进展!

旁听: @bctnry qq@百度_CAD qq@Exception

**组内事务**
- 需编写一个Q&A, 对常见问题/思路进行回应, 比如输入法+自动补全集成, 有 @lightrabbit 的[实现](https://github.com/program-in-chinese/overview/issues/11#issuecomment-320431936) 和 @htwx 针对CTS的实现.
- 考虑百度贴吧交流
